import React, { useState } from 'react';
import styled from 'styled-components';
import DatePicker from 'react-datepicker';
import 'react-datepicker/dist/react-datepicker.css';
import { useNavigate } from "react-router-dom";
import { FaCalendarAlt, FaMapMarkerAlt } from "react-icons/fa";

const MetaSearchFilter = ({ onFilterChange }) => {
    const [startDate, setStartDate] = useState(null);
    const [endDate, setEndDate] = useState(null);
    const [radius, setRadius] = useState(10);

    const navigate = useNavigate();

    const handleStartDateChange = (date) => {
        setStartDate(date);
        onFilterChange({ startDate: date, endDate, radius });
    };

    const handleEndDateChange = (date) => {
        setEndDate(date);
        onFilterChange({ startDate, endDate: date, radius });
    };

    const handleRadiusChange = (e) => {
        const value = Number(e.target.value);
        setRadius(value);
        onFilterChange?.({ startDate, endDate, radius: value });
    };

    return (
        <div>
            <ResultWrap>
                <Title>
                    <span role="img" aria-label="filter">🎛️</span> 검색 필터 설정하기
                </Title>
                <FilterCard>
                    <Section>
                        <Label>
                            <FaCalendarAlt style={{ marginRight: 6, color: '#4a90e2' }}/> 날짜 범위 선택
                        </Label>
                        <DatePickers>
                            <StyledDatePicker
                                selected={startDate}
                                onChange={handleStartDateChange}
                                selectsStart
                                startDate={startDate}
                                endDate={endDate}
                                placeholderText="시작 날짜"
                                dateFormat="yyyy-MM-dd"
                                isClearable
                            />
                            <StyledDatePicker
                                selected={endDate}
                                onChange={handleEndDateChange}
                                selectsEnd
                                startDate={startDate}
                                endDate={endDate}
                                minDate={startDate}
                                placeholderText="종료 날짜"
                                dateFormat="yyyy-MM-dd"
                                isClearable
                            />
                        </DatePickers>
                    </Section>

                    <Section>
                        <Label>
                            <FaMapMarkerAlt style={{ marginRight: 6, color: '#ff5a5f' }}/> 위치 기반 반경
                        </Label>
                        <RadiusRow>
                            <RadiusInput
                                type="range"
                                min={1}
                                max={100}
                                value={radius}
                                onChange={handleRadiusChange}
                                accentColor="#ff5a5f"
                            />
                            <RadiusValue>{radius} km</RadiusValue>
                        </RadiusRow>
                    </Section>
                </FilterCard>
            </ResultWrap>
            <ButtonContainer>
                <FloatingButton
                    onClick={() => navigate("/metasearch")}
                >
                    📸 + 이미지 검색하기
                </FloatingButton>
            </ButtonContainer>
        </div>
    );
};

const ResultWrap = styled.div`
    flex: 1;
    display: flex;
    flex-direction: column;
    align-items: center;
    margin-top: 30px;

    flex: 1;
    display: flex;
    flex-direction: column;
    overflow-y: auto;
    position: relative;
    margin-top:20px;
`;

const Title = styled.h2`
    font-size: 1.5rem;
    font-weight: 700;
    color: #222;
    margin-bottom: 18px;
    letter-spacing: -1px;
`;

const FilterCard = styled.div`
    display: flex;
    flex-direction: column;
    gap: 24px;
    padding: 32px 28px 24px 28px;
    background: white;
    border-radius: 20px;
    box-shadow: 0 8px 24px rgba(74, 144, 226, 0.08), 0 1.5px 4px rgba(0,0,0,0.03);
    max-width: 430px;
    min-width: 320px;
    width: 100%;
`;

const Section = styled.div`
    display: flex;
    flex-direction: column;
`;

const Label = styled.label`
    font-weight: 600;
    margin-bottom: 10px;
    color: #333;
    font-size: 1.08rem;
    display: flex;
    align-items: center;
`;

const DatePickers = styled.div`
    display: flex;
    gap: 12px;
`;

const StyledDatePicker = styled(DatePicker)`
    width: 130px;
    padding: 8px 12px;
    border: 1.5px solid #e3e8ee;
    border-radius: 8px;
    font-size: 1rem;
    background: #f7fafd;
    transition: border 0.2s;
    &:focus {
        outline: none;
        border-color: #4a90e2;
        background: #fff;
    }
`;

const RadiusRow = styled.div`
    display: flex;
    align-items: center;
    gap: 16px;
`;

const RadiusInput = styled.input`
    width: 100%;
    accent-color: #ff5a5f;
`;

const RadiusValue = styled.div`
    min-width: 50px;
    font-size: 1rem;
    color: #ff5a5f;
    font-weight: 700;
    text-align: right;
`;

const ButtonContainer = styled.div`
    display: flex;
    flex-direction: column; 
    align-items: flex-end;
    padding: 20px 40px 0 0;
`;

const FloatingButton = styled.button`
    align-self: flex-end;
    margin: 50px 0;
    background-color: #000000;
    color: white;
    border: none;
    border-radius: 12px;
    padding: 12px 15px;
    font-size: 0.9rem;
    cursor: pointer;
    transition: background-color 0.3s ease;

    &:hover {
        background-color: rgb(55, 58, 61);
    }
`;

export default MetaSearchFilter;
